import {Grid} from 'semantic-ui-react'

function SignUpForm () {
    // gym name - set by the click
    // select tier
    // name
    // email
    // phone
    // attached members - not required

    return (
        <div>
            <Grid>
                <Grid.Column width={2}></Grid.Column>
                    <Grid.Column width={12}>
                        <form class="ui form">
                            <div>
                                <div class="field">
                                    <label for="form-input-control-first-name">Gym</label>
                                    <div class="ui input">
                                        <input type="text" placeholder="First name" id="form-input-control-first-name"/>
                                    </div>
                                </div>
                                <div class="ui radio checkbox">
                                    <input valuetype="checkbox" class="hidden" readonly="" tabindex="0"/>
                                    <label> Tier1</label>
                                    <input value={"tier2"} type="checkbox" class="hidden" readonly="" tabindex="0"/>
                                    <label> Tier2</label>
                                </div>
                            </div>
                        </form>
                    </Grid.Column>
                <Grid.Column width={2}></Grid.Column>
            </Grid>
        </div>
    )
}

export default SignUpForm;
